import React from "react";
import logo from "./ApartmintLogoSmall.png";
import "./App.css";
import {
  // Container, Row, Col,
  Nav
} from "react-bootstrap";
import navBar from "./components/navBar/navBar";

function App() {
  return (
    <div className="App">
      <navBar />

      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
    </div>
  );
}

export default App;
